import { fetchPetsCreate } from "../../redux/slices/pets";
import { useDispatch} from "react-redux";

import "./styles/style-petcreate.css";

const PetCreateModal = ({ isOpen, onClose, id }) => {
    const dispatch = useDispatch();
    const onClickCreate = () => {
        dispatch(fetchPetsCreate(id));
    };
     
    return ( 
        <div>
        {isOpen && (
            <div className="modal">
                <div className="modal-content">
                    <span className="close" onClick={onClose}>
                        &times;
                    </span>
                    <p className='modal-title'>Оставить отзыв</p>
                    <form className='modal-form'>
                        <input className='modal-input' placeholder='Имя'></input>
                        <input className='modal-input' placeholder='Тип'></input>
                        <input className='modal-input' placeholder='Пол'></input>
                        <input className='modal-input' placeholder='Порода'></input>
                        <input className='modal-input' placeholder='Возраст'></input>
                    </form>
                    <button className='btn-create' onClick={onClickCreate} type='submit'>Изменить</button>
                </div>
            </div>
        )}
    </div>
     );
}
 
export default PetCreateModal;
